import Quiz from "./Quiz";
import Ques from "./Questions";
const Subject =()=>{
    const [Subject,setSubject]=useState([]);
    useEffect(()=>{

setSubject(()=>
    {
        return Array.from(new Set(Ques.map((val)=>
        {return val.subject}))
                        )
    }
        )
    },[])
    return (
        <>
       {Subject.map((val,index)=>{
        return <h2 key={index} onClick={(val)=>Choose(val)}>{val}</h2>
       })}
       <Quiz/>
        </>
    )
}
 const Choose=(elem)=>{
    alert(elem);
        return (
            <>
            <Quiz subj={elem}/>
            </>
        )
    }
